    accounts = Account.objects.filter(user=request.user)
    return render(request, 'dashboard.html', {'accounts': accounts})

def account_detail(request, account_id):
    account = get_object_or_404(Account, id=account_id)
    transactions = Transaction.objects.filter(account=account)
    return render(request, 'account_detail.html', {'account': account, 'transactions': transactions})

def add_account(request):
    if request.method == "POST":
        form = AccountForm(request.POST)
        if form.is_valid():
            account = form.save(commit=False)
            account.user = request.user
            account.save()
            return redirect('dashboard')
    else:
        form = AccountForm()
    return render(request, 'add_account.html', {'form': form})

def add_transaction(request, account_id):
    account = get_object_or_404(Account, id=account_id)
    if request.method == "POST":
        form = TransactionForm(request.POST)
        if form.is_valid():
            transaction = form.save(commit=False)
            transaction.account = account
            transaction.save()
            account.balance -= transaction.amount if transaction.is_expense else -transaction.amount
            account.save()
            return redirect('account_detail', account_id=account_id)
    else:
        form = TransactionForm()
    return render(request, 'add_transaction.html', {'form': form, 'account': account})

