from rest_framework.views import APIView
from rest_framework.response import Response
from rest_framework import status
from .models import Location
from .serializers import LocationSerializer
from geopy.distance import geodesic

class LocationListCreate(APIView):
    def get(self, request):
        locations = Location.objects.all()
        serializer = LocationSerializer(locations, many=True)
        return Response(serializer.data)

    def post(self, request):
        serializer = LocationSerializer(data=request.data)
        if serializer.is_valid():
            serializer.save()
            return Response(serializer.data, status=status.HTTP_201_CREATED)
        return Response(serializer.errors, status=status.HTTP_400_BAD_REQUEST)

class NearbyLocations(APIView):
    def get(self, request):
        longitude = request.query_params.get('longitude')
        latitude = request.query_params.get('latitude')
        radius = float(request.query_params.get('radius', 5.0))  # default radius is 5 km

        if not longitude or not latitude:
            return Response({"error": "Longitude and Latitude are required."}, status=status.HTTP_400_BAD_REQUEST)

        user_location = (float(latitude), float(longitude))
        nearby_locations = []

        for location in Location.objects.all():
            location_coords = (location.latitude, location.longitude)
            distance = geodesic(user_location, location_coords).km
            if distance <= radius:
                nearby_locations.append(location)

        serializer = LocationSerializer(nearby_locations, many=True)
        return Response(serializer.data)

