from django.shortcuts import render, redirect, get_object_or_404
from django.contrib.auth.decorators import login_required
from .models import AuctionListing, Bid, Comment
from .forms import AuctionListingForm, BidForm, CommentForm

@login_required
def create_listing(request):
    if request.method == 'POST':
        form = AuctionListingForm(request.POST)
        if form.is_valid():
            listing = form.save(commit=False)
            listing.created_by = request.user
            listing.save()
            return redirect('listing_detail', listing.id)
    else:
        form = AuctionListingForm()
    return render(request, 'create_listing.html', {'form': form})

def listing_detail(request, listing_id):
    listing = get_object_or_404(AuctionListing, pk=listing_id)
    bid_form = BidForm()
    comment_form = CommentForm()
    return render(request, 'listing_detail.html', {
        'listing': listing,
        'bid_form': bid_form,
        'comment_form': comment_form
    })

@login_required
def place_bid(request, listing_id):
    listing = get_object_or_404(AuctionListing, pk=listing_id)
    if request.method == 'POST':
        form = BidForm(request.POST)
        if form.is_valid():
            bid = form.save(commit=False)
            if bid.bid_amount > listing.current_bid:
                bid.listing = listing
                bid.bidder = request.user
                bid.save()
                listing.current_bid = bid.bid_amount
                listing.save()
    return redirect('listing_detail', listing.id)

@login_required
def add_comment(request, listing_id):
    listing = get_object_or_404(AuctionListing, pk=listing_id)
    if request.method == 'POST':
        form = CommentForm(request.POST)
        if form.is_valid():
            comment = form.save(commit=False)
            comment.listing = listing
            comment.author = request.user
            comment.save()
    return redirect('listing_detail', listing.id)

