from django.db import models
from django.contrib.auth.models import User

class RentalItem(models.Model):
    owner = models.ForeignKey(User, related_name='owned_items', on_delete=models.CASCADE)
    name = models.CharField(max_length=255)
    description = models.TextField()
    price_per_day = models.DecimalField(max_digits=10, decimal_places=2)
    available = models.BooleanField(default=True)

class RentalTransaction(models.Model):
    renter = models.ForeignKey(User, related_name='rented_items', on_delete=models.CASCADE)
    item = models.ForeignKey(RentalItem, related_name='transactions', on_delete=models.CASCADE)
    start_date = models.DateField()
    end_date = models.DateField()
    total_price = models.DecimalField(max_digits=10, decimal_places=2)
    status = models.CharField(max_length=50)


# views.py

from django.shortcuts import render, get_object_or_404, redirect
from django.contrib.auth.decorators import login_required
from django.urls import reverse
from .models import RentalItem, RentalTransaction
from .forms import RentalItemForm, RentalTransactionForm

@login_required
def list_rental_items(request):
    items = RentalItem.objects.filter(available=True)
    return render(request, 'rental/list_items.html', {'items': items})

@login_required
def add_rental_item(request):
    if request.method == 'POST':
        form = RentalItemForm(request.POST)
        if form.is_valid():
            item = form.save(commit=False)
            item.owner = request.user
            item.save()
            return redirect('list_rental_items')
    else:
        form = RentalItemForm()
    return render(request, 'rental/add_item.html', {'form': form})

@login_required
def rent_item(request, item_id):
    item = get_object_or_404(RentalItem, id=item_id, available=True)
    if request.method == 'POST':
        form = RentalTransactionForm(request.POST)
        if form.is_valid():
            transaction = form.save(commit=False)
            transaction.renter = request.user
            transaction.item = item
            transaction.total_price = item.price_per_day * (transaction.end_date - transaction.start_date).days
            transaction.status = 'Pending'
            transaction.save()
            item.available = False
            item.save()
            return redirect('list_rental_items')
    else:
        form = RentalTransactionForm()
    return render(request, 'rental/rent_item.html', {'form': form, 'item': item})


